import React, { useState, useEffect } from "react";
import axios from "axios";

const Color = () => {
  const [colors, setColors] = useState();

  async function fetchColors() {
    await axios
      .get(url)
      .then((res) => {
        setColors(res.data);
      })
      .catch((error) => console.log(error));
  }

  useEffect(() => {
    fetchColors();
  }, []);

  const url = "https://x-colors.herokuapp.com/api/random?number=7";

  return (
    <>
      {colors !== undefined ? (
        colors.map((color) => (
          <div
            className="color-boxes"
            style={{
              background: color.hsl,
              display: "flex",
              justifyContent: "center",
              width: "50%",
              margin: "1em",
              border: "1em black"
            }}
          >
            <h1>{color.hsl}</h1>
          </div>
        ))
      ) : (
        <p>Loading...</p>
      )}
      <button onClick={fetchColors}>New Colors</button>
    </>
  );
};

export default Color;
